import React from 'react';
import './Services.css';

function Services() {
  const services = [
    { title: 'Миндальный скраб с успокаивающей маской', price: '5360₽' },
    { title: 'Массаж тела на нефритовой кровати', price: '3216₽' },
    { title: 'Ламинирование / подтяжка ресниц / бровей', price: '4288₽' },
  ];

  return (
    <div className="services">
      <section className="services-innari-hero" style={{ backgroundImage: `url(/img/Лечение Иннари.webp)` }}>
        <div className="services-innari-overlay" />
        <div className="services-innari-content">
          <h1 className="services-innari-title">ЛЕЧЕНИЕ ИННАРИ</h1>
          <p className="services-innari-subtitle">Неинвазивные нити для лифтинга – мы одни из первых салонов, кто ввел эту инновационную процедуру</p>
        </div>
      </section>

      <section className="services-grid">
        {services.map((service, index) => (
          <div className="service-card" key={index}>
            <h2>{service.title}</h2>
            <span className="service-price">{service.price}</span>
          </div>
        ))}
      </section>
    </div>
  );
}

export default Services;
